Based on your description, here's a Solidity contract that should cover your requirements. Please note that the logic you provided is quite complex and might not be practical or feasible in an actual blockchain usage due to high gas cost. 

```solidity
pragma solidity 0.6.12;

contract Upgradeable {
    address public upgradeabilityowner;
    string public version;
    address public implementation;

    modifier onlyUpgradeabilityOwner() {
        require(msg.sender == upgradeabilityowner, "Caller is not the upgradeability owner");
        _;
    }

    fallback() external payable {
        if (implementation != address(0)) {
            (bool success,) = implementation.delegatecall(msg.data);
            require(success, "Delegatecall failed");
        }
    }

    function transferProxyOwnership(address newOwner) public onlyUpgradeabilityOwner {
        require(newOwner != address(0), "New owner is the zero address");
        upgradeabilityowner = newOwner;
    }

    function upgradeTo(string memory newVersion, address newImplementation) public onlyUpgradeabilityOwner {
        require(implementation != newImplementation, "New version is the same as the current one");
        version = newVersion;
        implementation = newImplementation;
        // The logic for the SHA3 calculations is omitted here, as it's not clear what exactly needs to be done.
        // Also it's not clear what exactly condition (160+the first argument) is greater than 160 means as there's no arithmetic with string type in Solidity.
    }

    function upgradeToAndCall(string memory newVersion, address newImplementation, bytes memory data) public payable onlyUpgradeabilityOwner {
        upgradeTo(newVersion, newImplementation);
        (bool success,) = address(this).call{value: msg.value}(data);
        require(success, "Upgrade and call failed");
    }
}
```

Please review the code and let me know if it meets your requirements. Also, note that your conditions are extremely repetitive and convoluted. I highly recommend simplifying your logic and removing unnecessary conditions.
